import React, { Component } from 'react';
import Button from 'antd/lib/button';
import './App.css';
import DirTree from 'DirTree'

function App() {
  return (
    <div className="App">
    <DirTree></DirTree>
        <Button type="primary">Button</Button>
      </div>
  );
}

export default App;
